import "./scss/main.scss"
import {BrowserRouter} from "react-router-dom";
import AppRouter from "./components/AppRouter";
import NavBar from "./components/NavBar";
import {observer} from "mobx-react-lite";


const App = observer(() => {
  return (
      <BrowserRouter>
          <NavBar/>
        <AppRouter/>
      </BrowserRouter>
  );
})

export default App;
